import React from "react";
function HomeCard(props) {
  return (
    <div className="backgroundtype-card-grey pb-3 mt-3">
      <h1>{props.header}</h1>
      <p>{props.mainContent}</p>
    </div>
  );
}

const HomePage = () => {
  return (
    <body className="container mt-3 ">
      <center>
        <HomeCard
          header="Welcome to Nick's React App"
          mainContent="Your currently on the homepage. Below is a list of options for pages or intrests that might suit you."
        />
        <HomeCard
          header="Intrested in learning more about me?"
          mainContent="Your currently on the homepage but if you navigate around using the
            color changing bar above, I'm sure you will have a blast learning
            more about me."
        />
        <HomeCard
          header="Trying to get ahold of me?"
          mainContent="Your currently on the homepage but if you navigate around using the
            color changing bar above, I'm sure you will have a blast learning
            more about me."
        />
      </center>
    </body>
  );
};
export default HomePage;
